// Get full LLM output
const content = $json["choices"][0]["message"]["content"];

// Only take the part after the first colon
const keywordBlock = content.split(':').slice(1).join(':').trim();

// Split each line and clean it
const keywords = keywordBlock
  .split('\n')
  .map(line => line.replace(/^\d+\.\s*/, '').trim()) // Remove number prefix like '1. '
  .filter(Boolean); // Remove empty lines

// Return each keyword as an item
return keywords.map(k => ({ json: { keyword: k } }));

const relatedKeywords = items[0].json["Related Keyword Data (Global)"];

if (!relatedKeywords || !Array.isArray(relatedKeywords)) {
  throw new Error("No related keyword data found.");
}

// STEP 1: Initial Filter (remove dead/zero keywords)
const filtered = relatedKeywords.filter(entry =>
  !(entry.competition_index === 0 && entry.avg_monthly_searches < 100)
);

// STEP 2: Sort by competition_index ASC, then avg_monthly_searches DESC
const sorted = filtered.sort((a, b) => {
  if (a.competition_index !== b.competition_index) {
    return a.competition_index - b.competition_index;
  }
  return b.avg_monthly_searches - a.avg_monthly_searches;
});

// STEP 3: Randomly pick 50 from top 100 sorted list
const top100 = sorted.slice(0, 100);

function getRandomSample(array, size) {
  const shuffled = [...array];
  for (let i = shuffled.length - 1; i > 0; i--) {
    const j = Math.floor(Math.random() * (i + 1));
    [shuffled[i], shuffled[j]] = [shuffled[j], shuffled[i]];
  }
  return shuffled.slice(0, size);
}

const random50 = getRandomSample(top100, 50);

// STEP 4: Re-sort selected 50 for final output
const finalSorted = random50.sort((a, b) => {
  if (a.competition_index !== b.competition_index) {
    return a.competition_index - b.competition_index;
  }
  return b.avg_monthly_searches - a.avg_monthly_searches;
});

// STEP 5: Output
return finalSorted.map(entry => ({
  json: {
    keyword: entry.keyword,
    avg_monthly_searches: entry.avg_monthly_searches,
    competition_index: entry.competition_index
  }
}));
